import React from 'react'
import { Container } from 'react-bootstrap'
import Header from './components/Header'
import Footer from './components/Footer'


const App = () => {
  return (
    <>
        <Header></Header>
        <main>
          <Container>
            <h1>test frontend</h1>
          </Container>

        </main>
        <Footer></Footer>
    </>
  );
}

export default App;
